import "bootstrap/dist/css/bootstrap.min.css";
// import React, { useState } from "react";
// import './css/style.css';
import {Container , Navbar , Nav } from 'react-bootstrap';
import { Link } from "react-router-dom";
import './css/style.css';



const NavB = () => {


return (
    <>

<Navbar bg="dark" expand="lg">
  <Container>
    <Navbar.Brand href="#home" className="text-warning" >Ahmed Elsobky</Navbar.Brand>
    <Navbar.Toggle aria-controls="basic-navbar-nav" />
    <Navbar.Collapse id="basic-navbar-nav">
      <Nav className="me-auto">
        <Link className="nav-link text-light" to="/">Home</Link>
        <Link className="nav-link text-light" to="/login">Login</Link>
        <Link className="nav-link text-light" to="/signup">Signup</Link>   
        <Link className="nav-link text-light" to="/favmovie">FavMovie</Link>    
        {/* <img src={require('./img/star (1).png')} className="offset:8 " width={"50px"} height={"50px"}/> */}
        <Link to="/favmovie">
        <div className={styles.navbar__cart}>
          <h3 className={styles.cart__title}>Cart</h3>
          <img
            className={styles.cart__image}
            src="https://image.flaticon.com/icons/svg/102/102276.svg"
            alt="shopping cart"
          />
          <div className={styles.cart__counter}>{cartCount}</div>
        </div>
      </Link>
      </Nav>
    </Navbar.Collapse>
  </Container>
</Navbar>








    </>
); 




}

export default NavB;
